import React from 'react';
import '../App.css';
import { useState } from 'react';
import { motion } from "framer-motion";

const AboutMe = () => {
  return (
    <section id="About">
      <h2>About Me</h2>
      <h5>Socials:</h5>
      <p>Instagram</p>
      <p>Facebook</p>
      <p>LinkedIn</p>
      <p>Spotify</p>
    </section>
  )
}

export default AboutMe
